import styled from 'styled-components';

export const Container = styled.main`
  margin-top: 40px;

.grid {
  width: 100%;
  height: 100%;
  display: grid;
  grid-gap: 20px;
  list-style: none;
  grid-template-columns: repeat(3, minmax(200px,1fr));
  width: 100%;
  padding: 4%;
}

`
